import React from "react";
import InternshipCard from "./InternshipCard";

const MatchesList = ({ internships }) => {
  if (!internships.length) return <p className="text-center text-gray-500">Your results will appear here</p>;

  return (
    <div className="flex-1 pl-6">
      {internships.map((job, i) => <InternshipCard key={i} {...job} />)}
    </div>
  );
};

export default MatchesList;
